import Sidebar from './components/layout/Sidebar';
import './assets/styles/global.css';

function App() {
  return (
      <div className="App">
        <Header />
        <div className="main-layout">
          <Sidebar />
          <main className="content">
          </main>
        </div>
        <Footer />
      </div>
  );
}

export default App;
